tables.table_schema:
CREATE TABLE LeadScoringModels (
 lead_id INT PRIMARY KEY,
 lead_name VARCHAR(255),
 lead_score FLOAT
);

CREATE TABLE lead_scores (
    lead_id INT PRIMARY KEY,
    lead_name VARCHAR(255),
    lead_score INT
);

CREATE TABLE lead_history (
    history_id INT PRIMARY KEY,
    lead_id INT,
    lead_status VARCHAR(50),
    last_interaction TIMESTAMP
);

CREATE TABLE lead_scores (
    lead_id INT PRIMARY KEY,
    lead_name VARCHAR(50),
    lead_score INT
);

CREATE TABLE lead_interaction (
    interaction_id INT PRIMARY KEY,
    lead_id INT,
    interaction_type VARCHAR(50),
    interaction_date DATE
);

CREATE TABLE sales_efforts (
    lead_id INT,
    sales_rep VARCHAR(50),
    sales_date DATE,
    deal_value DECIMAL
);

CREATE TABLE leads (
    lead_id UUID PRIMARY KEY,
    lead_name VARCHAR(255),
    lead_email VARCHAR(255),
    lead_score INT
);

CREATE TABLE lead_scores (
    score_id UUID PRIMARY KEY,
    lead_id UUID REFERENCES leads(lead_id),
    lead_score INT,
    last_updated TIMESTAMP
);

CREATE TABLE sales_team (
    team_id UUID PRIMARY KEY,
    team_name VARCHAR(255),
    team_leader_id UUID REFERENCES sales_reps(sales_rep_id)
);

CREATE TABLE sales_reps (
    sales_rep_id UUID PRIMARY KEY,
    sales_rep_name VARCHAR(255),
    team_id UUID REFERENCES sales_team(team_id)
);
